pragma solidity ^0.5.0;

contract AppointmentsManagement{
    enum  SexType { MALE, FEMALE }
    enum AppointmentStat { CREATED, CANCELLED, CONFIRMED }
    string public hospitalName;
    address payable public hospitalOwner;
    uint public appointmentNumber = 0;
    address[] public patients;
    struct Appointment{
        uint appointmentId;
        address patientAddress;
        string patientName;
        uint dateTime;
        SexType sex;
        AppointmentStat aptStatus;
    }

    mapping(address => Appointment) public appointments;

    event AppointmentBooking(
        uint appointmentId,
        address patientAddress,
        string patientName,
        uint dateTime,
        SexType sex,
        AppointmentStat aptStatus
    );

    event AppointmentCancelling(
        uint appointmentId,
        address patientAddress,
        string patientName,
        uint dateTime,
        SexType sex,
        AppointmentStat aptStatus
    );

    event AppointmentConfirming(
        uint appointmentId,
        address patientAddress,
        string patientName,
        uint dateTime,
        SexType sex,
        AppointmentStat aptStatus
    );

    constructor() public {
        hospitalName = "UBC Patient Appointment";
        hospitalOwner = msg.sender;
    }

    function createAppointment(string memory _patientName, uint _dateTime, SexType _sex) public payable {
        require(bytes(_patientName).length > 0, "Patient's name is required!");
        require(_dateTime > now, "Please prvide valid date");
        uint value = 1000000000000000000;
        require(msg.value >= value, "Payment should be enough!");
        uint256[] memory results;
        uint256 count = 0;
        
        for (uint256 i = 0; i < patients.length; i++) {
            if((appointments[patients[i]].patientAddress == msg.sender) && (appointments[patients[i]].aptStatus == AppointmentStat.CREATED))
            {
                results[count] = i;
                count++;
            }
        }
        require(count == 0, "You already have an appointment with doctor");
        appointmentNumber++;
        patients.push(msg.sender);
        appointments[msg.sender] = Appointment(appointmentNumber, msg.sender, _patientName, _dateTime, _sex, AppointmentStat.CREATED);
        hospitalOwner.transfer(msg.value);

        
        emit AppointmentBooking(appointmentNumber, msg.sender, _patientName, _dateTime, _sex, AppointmentStat.CREATED);
    }

    function cancelAppointmnet(uint _appointmentNumber) public {
        Appointment memory _apt = appointments[msg.sender];
        require(_apt.appointmentId > 0 && _apt.appointmentId <= appointmentNumber, "AppointmentID should be valid!");
        require(_apt.appointmentId == _appointmentNumber, "AppointmentID is not created by caller!");
        require(_apt.aptStatus != AppointmentStat.CANCELLED, "Appointmnet should not be already cancelled!");
        require(_apt.aptStatus != AppointmentStat.CONFIRMED, "Appointmnet should not be already confirmed!");
        require(_apt.aptStatus == AppointmentStat.CREATED, "Appointmnet should be created!");
        //require(_apt.patientAddress != msg.sender, "Appointmenet was created by somebody else and only that person can cancel!");
        _apt.aptStatus = AppointmentStat.CANCELLED;
        appointments[msg.sender] = _apt;
        emit AppointmentCancelling(_appointmentNumber, msg.sender, _apt.patientName, _apt.dateTime, _apt.sex, AppointmentStat.CANCELLED);
    }

    function confirmAppointment(uint _appointmentNumber) public {
        
        
        require(msg.sender == hospitalOwner, "Only doctor/owner can confirm the appointment!");
        require(_appointmentNumber > 0 && _appointmentNumber <= appointmentNumber, "AppointmentID should be valid!");
        
        address patient;

        for (uint256 i = 0; i < patients.length; i++) {
            if((appointments[patients[i]].appointmentId == _appointmentNumber))
            {
                patient = appointments[patients[i]].patientAddress;
            }
        }

        Appointment memory _apt = appointments[patient];
        address patientAdress = _apt.patientAddress;
        require(_apt.aptStatus != AppointmentStat.CANCELLED, "Appointmnet is already cancelled!");
        require(_apt.aptStatus != AppointmentStat.CONFIRMED, "Appointmnet is already confirmed!");
        require(_apt.aptStatus == AppointmentStat.CREATED, "Appointmnet should be created!");

        _apt.aptStatus = AppointmentStat.CONFIRMED;
        appointments[patientAdress] = _apt;
        emit AppointmentConfirming(_appointmentNumber, patient , appointments[patientAdress].patientName, appointments[patientAdress].dateTime, appointments[patientAdress].sex, appointments[patientAdress].aptStatus);
    }
}
